import React from 'react'
import logo from '../images/logo1.png'

const Header = () => {
  return (
    <div>
      <img src={logo} alt="Fiverr" style={{width: '100px', height: '50px'}}/>
      <div>
        <input type="text" />
      </div>
    </div>
  )
}

export default Header
